    n = len(matrix)
    m = len(matrix[0])
    ans = [[0 for _ in range(m + 1)] for _ in range(n + 1)]
    for (x1, y1, x2, y2) in queries:
        x1 += 1
        y1 -= 1
        x2 -= 1
        y2 -= 1
        ans[x1][y1] += 1
        ans[x2 + 1][y1] -= 1
        ans[x1][y2 + 1] -= 1
        ans[x2 + 1][y2 + 1] += 1
    for j in range(m + 1):
        for i in range(1, n + 1):
            ans[i][j] = ans[i - 1][j] + ans[i][j]
    for i in range(n + 1):
        for j in range(1, m + 1):
            ans[i][j] = ans[i][j - 1] + ans[i][j]
    for i in range(n):
        for j in range(m):
            matrix[i][j] = (ans[i][j] + matrix[i][j]) % 2
    return matrix

